<!DOCTYPE html>

<html xmlns="http://www.w3.org/1999/xhtml">
<head>
	<link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous">
	<meta charset="utf-8" />
	<title>WebSassCompiler</title>
</head>
<body>
	<nav class="navbar navbar-light bg-light">
		<span class="navbar-brand mb-0 h1">WebSassCompiler</span>
	</nav>
	<section class="container">
		<form class="form col-12 col-lg-6" action="/" method="post" enctype="multipart/form-data">
			<div class="form-group">
				<label for="entryFile">EntryFile</label>
				<input class="form-control" type="text" name="entryFile" id="entryFile" placeholder="e.g. src/scss/main.scss" />
				<small id="entryFileHelp" class="form-text text-muted">This should be relative to to the root folder inside the zip Archive</small>
			</div>
			<div class="form-group">
				<label for="zip">Zip Archive</label>
				<input class="form-control-file" accept=".zip" type="file" name="zip" id="zip" />
			</div>
			<div class="form-group">
				<label for="outputStyle">Style</label>
				<select class="form-control" name="outputStyle" id="outputStyle">
					<option value="nested">Nested</option>
					<option value="compact">Compact</option>
					<option value="expanded" selected>Expanded</option>
					<option value="compressed">Compressed</option>
				</select>
				<small id="outputStyleHelp" class="form-text text-muted">Choose Compressed to remove whitespaces to reduce filesize</small>
			</div>
			<div class="form-group">
				<button class="btn btn-primary" type="submit">Upload</button>
			</div>
		</form>
